INSERT INTO `medicalhistory` VALUES (1,'Острая респираторная инфекция','Пациент жалуется на кашель, насморк и общую слабость. Температура тела 38°C.','2023-11-15'),(2,'Гипертоническая болезнь','Повышенное артериальное давление, головные боли, головокружение. Назначены гипотензивные препараты.','2022-05-20'),(3,'Сахарный диабет 2 типа','Повышенный уровень глюкозы в крови. Рекомендована диета и пероральные сахароснижающие средства.','2023-01-08'),(4,'Хронический бронхит','Длительный кашель с выделением мокроты. Назначены бронхолитики и муколитики.','2021-09-01'),(5,'Ишемическая болезнь сердца','Стенокардия, одышка при физической нагрузке. Рекомендована консультация кардиолога.','2022-03-28'),(6,'Остеохондроз позвоночника','Боли в спине, ограничение подвижности. Назначены нестероидные противовоспалительные препараты.','2023-07-10'),(7,'Гастрит','Боли в животе, изжога, тошнота. Рекомендована диета и антациды.','2022-08-17'),(8,'Аллергический ринит','Насморк, зуд в носу, чихание. Назначены антигистаминные препараты.','2023-02-05'),(9,'Мигрень','Сильные головные боли, тошнота, светобоязнь. Назначены анальгетики и триптаны.','2021-06-22'),(10,'Анемия','Слабость, утомляемость, бледность кожных покровов. Рекомендован прием препаратов железа.','2022-04-03'),(11,'Вирусная инфекция верхних дыхательных путей','Лихорадка, озноб, боль в горле и кашель.','2023-02-10'),(12,'Хроническая обструктивная болезнь легких (ХОБЛ)','Прогрессирующее ограничение воздушного потока в легких.','2022-09-15'),(13,'Ревматоидный артрит','Хроническое воспалительное заболевание суставов.','2023-03-22'),(14,'Острая кишечная инфекция','Тошнота, рвота, диарея и боли в животе.','2021-11-05'),(15,'Почечная недостаточность','Нарушение функции почек с повышенным содержанием креатинина.','2022-07-01'),(16,'Диабетическая невропатия','Повреждение нервов из-за высокого уровня глюкозы в крови.','2023-05-12'),(17,'Синдром раздраженного кишечника (СРК)','Хронические боли в животе и нарушения стула.','2021-01-05'),(18,'Тромбофлебит','Воспаление вены с образованием тромба.','2022-08-18'),(19,'Гипотиреоз','Недостаточная функция щитовидной железы с усталостью и замедленным метаболизмом.','2023-04-25'),(20,'Бронхиальная астма','Хроническое воспалительное заболевание дыхательных путей.','2021-12-01'),(21,'Артроз коленного сустава','Хроническое дегенеративное заболевание коленного сустава','2023-06-10'),(22,'Острый ларингит','Воспаление гортани, характеризующееся осиплостью голоса и болью при глотании','2022-02-15'),(23,'Пиелонефрит','Воспаление почек, вызванное бактериальной инфекцией','2023-09-01'),(24,'Дисциркуляторная энцефалопатия','Хроническое нарушение кровообращения головного мозга','2021-05-20'),(25,'Хронический панкреатит','Длительное воспаление поджелудочной железы','2022-11-12'),(26,'Вегетососудистая дистония','Нарушение регуляции тонуса сосудов','2023-08-05'),(27,'Ожирение','Избыточное накопление жира в организме','2021-01-28'),(28,'Глаукома','Повышенное внутриглазное давление, приводящее к повреждению зрительного нерва','2022-04-15'),(29,'Фурункулез','Множественные гнойные воспаления волосяных фолликулов','2023-10-08'),(30,'Синусит','Воспаление слизистой оболочки околоносовых пазух','2021-07-01'),(31,'Воспаление легких','Кашель с гнойной мокротой, повышение температуры, слабость','2023-07-18'),(32,'Ишемический инсульт','Нарушение кровообращения мозга, паралич правой стороны','2022-03-03'),(33,'Миокардит','Воспаление сердечной мышцы, одышка, отеки','2021-09-22'),(34,'Нестабильная стенокардия','Приступы сжимающей боли в груди, отдающие в левую руку','2022-11-05'),(35,'Хроническая почечная недостаточность','Ухудшение функции почек, отеки, повышенное давление','2023-05-15'),(36,'Эпилепсия','Судороги, потеря сознания, тонические сокращения мышц','2021-01-08'),(37,'Псориаз','Хроническое заболевание кожи, образование красных бляшек','2022-06-10'),(38,'Остеопороз','Снижение плотности костной ткани, частые переломы','2023-10-12'),(39,'Тромбоэмболия легочной артерии','Внезапная одышка, боли в груди, кашель','2021-07-15'),(40,'Двусторонняя пневмония','Температура 39, озноб, кашель с выделением гнойной мокроты','2022-03-20'),(41,'Язвенная болезнь желудка','Режущие боли в животе после приема пищи','2022-03-20'),(42,'Острый аппендицит','Резкая боль в правой подвздошной области','2022-03-20'),(43,'Травматический шок','Сильное снижение давления, общая слабость после травмы','2022-03-20'),(44,'Перелом шейки бедра','Невозможность движения ногой, резкая боль','2022-03-20'),(45,'Отек Квинке','Отек лица, шеи, затрудненное дыхание','2022-03-20'),(46,'Отравление грибами','Тошнота, рвота, боли в животе после употребления грибов','2022-03-20'),(47,'Эклампсия','Судороги у беременной женщины','2022-03-20'),(48,'Клиническая смерть','Отсутствие дыхания и пульса','2022-03-20');
